import "./Login.css";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
const customTextFieldStyle = {
  width: '400px',             // Adjust the width to your desired length
  borderColor: 'blue',        // Set the outline color to blue
};

const Login = ({ onClose }) => {
  return (
    <div className="login1">
      <div className="login-child" />
      <img className="icon2" alt="" src="/undefined141.png" />
      <div className="login2">Login</div>
      <div className="login-item" />
      <Button variant="contained" sx={{position:"relative",top:"500px",left:"180px"}}>Continue</Button>
      <div className="parent">
      <TextField
      label="Text Field"
      variant="outlined"
      style={customTextFieldStyle}
    />
      </div>
    </div>
  );
};

export default Login;
